window.bookSummaryJSON = "<p><b>He was supposed to be a stranger, someone on the other side of the wall, there to please me and me, them.</b></p> <p>No matter how much I try, I can't stop thinking about the man who can make my fantasies come to life in a way no one else has. Nothing could have prepared me for the reveal of my mystery man.</p> <p>I was supposed to be working on myself, trying to figure out my identity outside of my family or a boyfriend. Which led me to explore my desires at the local club, Avalon. And what I found there was more than I bargained for.</p> <p>He's not just funny, attentive, and slightly obsessed with me. He's also the last man I should be falling in love with.</p> <p>I was on a mission to find out who I was, and I did, just in the arms of a man who is forbidden to me—Lincoln Carlson. I just hope we don't destroy our families in the wake of our desire, because no matter how hard I try, I can't seem to stay away.</p> <p>Forget Your Morals <i>is a standalone interconnected with </i>Swallow Your Pride.<i> These books can be enjoyed in either order.</i></p>"; 
